  /*  Type I and Type II linear phase FIR  */
  /*  basis vectors are cos(2*pi*m*f) (see m below) */
  /*  type I */
  /*      k=m'; */
  /*  entries are m + k */
  /*  entries are m - k */
  memset(&G[0], 0, 5776U * sizeof(double));
  b0 = 0.0;

  /*   first entry must be handled separately (where k(1)=0) */
  memset(&b[0], 0, 75U * sizeof(double));
  for (s = 0; s < 3; s++) {
    b_s = s << 1;
    m = (double)(M[b_s + 1] - M[b_s]) / (F[b_s + 1] - F[b_s]);

    /*   slope */
    b1 = (double)M[b_s] - m * F[b_s];

    /*   y-intercept */
    b0 += b1 * (F[b_s + 1] - F[b_s]) + m / 2.0 * (F[b_s + 1] * F[b_s + 1] -
      F[b_s] * F[b_s]);
    y = m / 39.478417604357432;
    for (i = 0; i < 75; i++) {
      b_b[i] = a[i] * F[b_s + 1];
    }

    b_cos(b_b);
    for (i = 0; i < 75; i++) {
      c_b[i] = a[i] * F[b_s];
    }

    b_cos(c_b);
    for (i = 0; i < 75; i++) {
      b_y[i] = y * (b_b[i] - c_b[i]);
    }

    rdivide(b_y, dv1, b_b);
    b_a = F[b_s + 1] * (m * F[b_s + 1] + b1);
    for (i = 0; i < 75; i++) {
      b_y[i] = (2.0 + 2.0 * (double)i) * F[b_s + 1];
      b[i] += b_b[i];
    }

    sinc(b_y, b_b);
    y = F[b_s] * (m * F[b_s] + b1);
    for (i = 0; i < 75; i++) {
      b_y[i] = (2.0 + 2.0 * (double)i) * F[b_s];
    }

    sinc(b_y, c_b);
    for (i = 0; i < 75; i++) {
      b[i] += b_a * b_b[i] - y * c_b[i];
    }

    b_a = 0.5 * F[b_s + 1];
    for (i = 0; i < 5776; i++) {
      c_a[i] = (double)d_a[i] * F[b_s + 1];
    }

    b_sinc(c_a, d_b);
    for (i = 0; i < 5776; i++) {
      c_a[i] = (double)e_a[i] * F[b_s + 1];
    }

    b_sinc(c_a, dv2);
    y = 0.5 * F[b_s];
    for (i = 0; i < 5776; i++) {
      c_a[i] = (double)d_a[i] * F[b_s];
      d_b[i] += dv2[i];
    }

    b_sinc(c_a, e_b);
    for (i = 0; i < 5776; i++) {
      c_a[i] = (double)e_a[i] * F[b_s];
    }

    b_sinc(c_a, dv2);
    for (i = 0; i < 5776; i++) {
      G[i] += b_a * d_b[i] - y * (e_b[i] + dv2[i]);
    }
  }

